    def isSubsequence(self, s: str, t: str) -> bool:

        length_s = len(s)
        length_t = len(t)
        i = 0
        j = 0
        count = 0
        while (i < length_s and j < length_t):
            if t[j] == s[i]:
                j += 1
                i += 1
                count += 1
            else:
                j += 1
        if count == length_s:
            return True
        else:
            return False


